import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
const cors = require('cors')
const express = require('express')
const app = express()
app.use(cors())
root.render(
    <App />
);
